import { liveGoodsDetail } from '@/api/live'
export default {
    name: "live_detail",
    data() {
        return {
            option: {
                form: {
                    labelWidth: '150px'
                }
            },
            FormData: {},
            loading: false
        }
    },
    methods:{
        getData(id) {
            this.loading = true
            liveGoodsDetail(id)
                .then((res) => {
                    this.FormData = res.data
                    this.loading = false
                })
                .catch(error => {
                    this.$Message.error(error.msg)
                    this.loading = false
                })
        },
    }
}
